import React, { useState } from "react";

function App() {
  const [emulationStatus, setEmulationStatus] = useState("");

  const handleEmulate = () => {
    fetch('http://localhost:5000/emulate')
      .then(response => response.text())
      .then(data => {
        console.log(data);
        setEmulationStatus(data);
      })
      .catch(error => {
        console.error('Error:', error);
        setEmulationStatus('Error al iniciar la emulaci贸n');
      });
  };

  const handleStop = () => {
    fetch('http://localhost:5000/stop')
      .then(response => response.text())
      .then(data => {
        console.log(data);
        setEmulationStatus(data);
      })
      .catch(error => {
        console.error('Error:', error);
        setEmulationStatus('Error al detener la emulaci贸n');
      });
  };

  return (
    <div>
      <header>
        <h1>Interfaz de Usuario</h1>
        <button onClick={handleEmulate}>Emular</button>
        <button onClick={handleStop}>Detener</button>
        <p>{emulationStatus}</p>
      </header>
    </div>
  );
}

export default App;
